import React from 'react'
import Grid from '@material-ui/Grid';
import FormLabel from '@material-ui/FormLabel';
import Paper from '@material-ui/material/Paper';
import FormControl from '@material-ui/FormControl';
import FormControlLabel from '@material-ui/FormControlLabel';
import ProductCard from '../ProductCard/ProductCard';

export default function Products() {
    /*return (
        <div>
            <h1>Products</h1>
            <ProductCard/>
        </div>
    )*/

    return (
        <Grid sx={{ flexGrow: 1 }} container spacing={2}>
          <Grid item xs={12}>
            <Grid container justifyContent="center" spacing={spacing}>
              {[0, 1, 2].map((value) => (
                <Grid key={value} item>
                  <Paper sx={{ height: 140, width: 100 }} />
                </Grid>
              ))}
            </Grid>
          </Grid>
          <Grid item xs={12}>
            <Paper sx={{ p: 2 }}>
              <Grid container>
                <Grid item>
                  <FormControl component="fieldset">
                    <FormLabel component="legend">spacing</FormLabel>
                    <RadioGroup
                      name="spacing"
                      aria-label="spacing"
                      value={spacing.toString()}
                      onChange={handleChange}
                      row
                    >
                      {[0, 0.5, 1, 2, 3, 4, 8, 12].map((value) => (
                        <FormControlLabel
                          key={value}
                          value={value.toString()}  
                          control={<Radio />}
                          label={value.toString()}
                        />
                      ))}
                    </RadioGroup>
                  </FormControl>
                </Grid>
              </Grid>
            </Paper>
            <HighlightedCode code={jsx} language="jsx" />
          </Grid>
        </Grid>
      );
}
